import axios from "axios";

export const cancelOfferedValue = async (productDetailId, config) => {
  await axios
    .delete(
      `http://bootcampapi.techcs.io/api/fe/v1/account/cancel-offer/${productDetailId}`,
      config
    )
    .then((response) => console.log(response))
    .catch((err) => console.log(err));
};
